        private void ProcessFiles(string[] fileNames)
        {
            List<Asterix> packets = new List<Asterix>();
            int tempcat21Counter = 0;//заглушки для тестирования, позже убрать
            int tempcat34Counter = 0;
            int tempcat48Counter = 0;
            int tempcat8Counter = 0;
            int tempcatOtherCounter = 0;
            //для работы с прогрессбаром
            int total = fileNames.Length;
            double tick = 100.0 / total;
            token = 0.0;
            //to find file currently in use
            
            foreach (string fileName in fileNames)
            {
                //FileInfo fI = new FileInfo(fileName)
                //if(fI.LastWriteTime-DateTime.Now)
                using (FileStream fs = new FileStream(fileName, FileMode.Open))
                {
                    byte[] temp = new byte[fs.Length];
                    fs.Read(temp, 0, temp.Length);
                    string[] processing = (BitConverter.ToString(temp)).Split('-');

                    packets.AddRange(FileProcessor.Process(processing, out tempcat21Counter, out tempcat34Counter,
                        out tempcat48Counter, out tempcat8Counter, out tempcatOtherCounter));
                    PPI.ProcessPackets(packets);
                    packets = new List<Asterix>();

                    GC.Collect();
                }


                if (token + tick > 100)
                    token = 100;
                else
                {
                    token += tick;
                }

                this.Dispatcher.BeginInvoke((DispatcherPriority.Normal), (ThreadStart) delegate() { Bar.Value = token;});

            }

            this.Dispatcher.BeginInvoke((DispatcherPriority.Send),
                (ThreadStart)CalculationFinishedGUI);
            this.Dispatcher.BeginInvoke((DispatcherPriority.Normal),
                (ThreadStart)Redraw);

        }
        
        private void Recalculate(object sender, RoutedEventArgs e)
        {
            CalculationStartedGUI();
            Action a = () => ProcessFiles(fileNames);
            Task task1 = new Task(a);
            task1.Start();
            //Redraw();
            //CalculationFinishedGUI();
        }
        
        private void Redraw()
        {
            SetLinkToDictionary();
            if(rgState==5)
            {
                for (int az = 0; az < 360 / azState; az++)
                {
                    for (int rg = 0; rg < 65 / rgState; rg++)
                    {
                        double temp = 0;
                        if (prDisplayState == 1)
                        {
                            temp = (PPI.GetCell(azState, rgState, az, rg, flState)).PrSSR;
                        }
                        else if (prDisplayState == 0)
                        {
                            temp = (PPI.GetCell(azState, rgState, az, rg, flState)).PrPSR;
                        }
                        else
                        {
                            throw new ArgumentException("Wrong PRDisplayState selected!!!");
                        }

                        //Path tempPath = GetPath(az, rg, flState);
                        if (temp >= 0.95)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Green);
                        }
                        else if (temp >= 0.85)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Yellow);
                        }
                        else if (temp > 0)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Red);
                        }
                        else
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.White);
                        }
                    }
                }
            }
            else
            {
                for (int az = 0; az < 360 / azState; az++)
                {
                    for (int rg = 0; rg < 500 / rgState; rg++)
                    {
                        double temp = 0;
                        if (prDisplayState == 1)
                        {
                            temp = (PPI.GetCell(azState, rgState, az, rg, flState)).PrSSR;
                        }
                        else if (prDisplayState == 0)
                        {
                            temp = (PPI.GetCell(azState, rgState, az, rg, flState)).PrPSR;
                        }
                        else
                        {
                            throw new ArgumentException("Wrong PRDisplayState selected!!!");
                        }
                        if (temp >= 0.95)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Green);
                        }
                        else if (temp >= 0.85)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Yellow);
                        }
                        else if (temp > 0)
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.Red);
                        }
                        else
                        {
                            GetPath(az, rg, flState).Fill = new SolidColorBrush(Colors.White);
                        }
                    }
                }
            }
        }
        
