        //получает путь к ячейке исходя из полученных данных
        public Path GetPath(int x, int y, int z)
        {
            Path temp = null;
            
            if (currentLink.TryGetValue(new Key(x, y, z), out temp))
            {
                return temp;
            }
            throw new ArgumentNullException($"No path to radar cell was found for key x:{x},y:{y},z:{z}");
        }
        //получает ключ к ячейке по названию (пути)
        public static Key GetKey(string path, int flightLevel)
        {
            try
            {
                var temp = currentLink.First(x => x.Value.Name == path && x.Key.Altitude == flightLevel).Key;
                return (Key)temp;
            }
            catch (Exception e)
            {
                Console.WriteLine("Key cannot be extracted!");
            }

            throw new InvalidOperationException("Key cannot be extracted!");
        }
        
